import React from "react";

import { Text, Image, View, StyleSheet, ScrollView, Card } from "react-native";

const ItemTemplate = () => {
  return (
    <View style={styles.container}>
      <Image source={{uri: 'https://wallpapercave.com/wp/wp2551790.jpg'}} style={{width: 400, height: 400}} />
      <Text>ID: </Text>
      <Text>Name: </Text>
      <Text>Price: </Text>
    </View>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: "column",
    justifyContent: "space-between",
    margin: auto,
  },

});

export default ItemTemplate;
